import React from 'react';
import styled from 'styled-components';
import { 
	CaptionLight,
	CaptionBold,
	Paragraph,
	HeaderSmall,
	HeaderMedium,
	HeaderLarge
 } from 'components/core/Type';

const ResumeSection = styled.section`
	display: flex;
	justify-content: center;
	padding: 2rem;
`;

const ResumeGrid = styled.article`
	display: grid;
	width: 100%;
	max-width: 50rem;
`;

const ResumeHeader = () => (
	<header>
		<HeaderLarge>Resume</HeaderLarge>
	</header>
);

const JobHeader = styled(HeaderMedium)`
	margin-bottom: 0;
`;

const WorkExperience = () => (
	<div>
		<HeaderMedium>Work Experience</HeaderMedium>
		<JobHeader>Job 1</JobHeader>
		<Paragraph>Description of job.</Paragraph>
		<JobHeader>Job 1</JobHeader>
		<Paragraph>Description of job.</Paragraph>
	</div>
);

const Resume = () => (
	<ResumeSection>
		<ResumeGrid>
			<ResumeHeader />
			<WorkExperience />
		</ResumeGrid>
	</ResumeSection>
);

export default Resume;
